    public void loadDataFeatures() {
        try {
            faceFeatures = new ArrayList<>();
            FileInputStream fis = null;
            InputStreamReader isr = null;
            BufferedReader br = null; // 用于包装InputStreamReader,提高处理性能。因为BufferedReader有缓冲的，而InputStreamReader没有。
            fis = new FileInputStream("feature.txt");// FileInputStream
            // 从文件系统中的某个文件中获取字节
            isr = new InputStreamReader(fis);// InputStreamReader 是字节流通向字符流的桥梁,
            br = new BufferedReader(isr);// 从字符输入流中读取文件中的内容,封装了一个new	             InputStreamReader的对象

            String str = "";
//            Long time = System.currentTimeMillis();
            while ((str = br.readLine()) != null) {
                byte[] featureInByte_temp = FeatureUtils.hexStringToBytes(str);
                this.faceFeatures.add(AFR_FSDK_FACEMODEL.fromByteArray(featureInByte_temp));
            }
//            System.out.println("read file:");
//            System.out.println(System.currentTimeMillis() - time);
            System.out.println("人数:"+String.valueOf(this.faceFeatures.size()));
        } catch (Exception e) {
            e.printStackTrace();
        }

    }

    public float compareFaceSimilarityTWO(AFR_FSDK_FACEMODEL faceFeatureA, AFR_FSDK_FACEMODEL faceFeatureB) throws Exception {
//        Long time = System.currentTimeMillis();
        // calc similarity between faceA and faceB
        FloatByReference fSimilScore = new FloatByReference(0.0f);
        NativeLong ret = this.AFR_FSDKLibrary_INSTANCE.AFR_FSDK_FacePairMatching(this.hFREngine, faceFeatureA, faceFeatureB, fSimilScore);
        faceFeatureA.freeUnmanaged();
        faceFeatureB.freeUnmanaged();
        if (ret.longValue() != 0) {
            System.out.println(String.format("AFR_FSDK_FacePairMatching failed:ret 0x%x", ret.longValue()));
            return 0.0f;
        }
        System.out.print("TWO----time:\r");
//        System.out.println(System.currentTimeMillis() - time);
        return fSimilScore.getValue();
    }

    public synchronized  double[] compareFaceSimilarityMany(AFR_FSDK_FACEMODEL faceFeature) throws Exception {
        double[] res = new double[3];
        try {

            Long time= System.currentTimeMillis();
            FloatByReference fSimilScore = new FloatByReference(0.0f);
            res[0] = 0;
            res[1] = 0;
            res[2] = 0;
            for (int k = 0; k < this.faceFeatures.size(); k++) {
                NativeLong ret = this.AFR_FSDKLibrary_INSTANCE.AFR_FSDK_FacePairMatching(this.hFREngine, faceFeature, this.faceFeatures.get(k), fSimilScore);
                if (ret.longValue() != 0) {
                    System.out.println(String.format("AFR_FSDK_FacePairMatching  Many failed:ret 0x%x", ret.longValue()));
                    //faceFeature.freeUnmanaged();
                    res[0] = 1;
                    break;
                }
                if (res[1] < fSimilScore.getValue()) {
                    res[1] = fSimilScore.getValue();
                    res[2] = k+1;
                    if(res[1]>0.95) break;
                }
            }
            System.out.println("人脸搜索时间:"+String.valueOf(System.currentTimeMillis()-time));
            faceFeature.freeUnmanaged();
        } catch (Exception e) {
            e.printStackTrace();
            return res;
        }
        return res;
    }


